import { Link } from "react-router-dom";

function Actions({currentPage, showPrevPage, showNextPage}) {

    return (
        <div className="slider-actions-container">
            {currentPage === 0 
                ? <span></span>
                : <button onClick={showPrevPage} 
                    className="slider-action p">
                    Prev
                </button>
            }
            {currentPage === 1
                ? <Link to={'/home'} className='slider-action slider-action-finish p'>
                        Finish
                    </Link>
                : <button onClick={showNextPage}  
                    className="slider-action p">
                    Next
                </button>
            }
        </div>
    );
}

export default Actions;
